using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class Site	{		private Guid siteKey;		private string name;		private string street;		private string numExt;		private string numInt;		private string suburb;		private string delegation;		private string town;		private string zip;		private int employeNumber;		private bool? isPrincipal;		private string googlePoint;		private Guid? stateFk;		private Guid? clienteFk;		private Guid? regionFk;		public Site(){}		public Guid SiteKey		{			get { return siteKey; }			set { siteKey = value; }		}		public string Name		{			get { return name; }			set { name = value; }		}		public string Street		{			get { return street; }			set { street = value; }		}		public string NumExt		{			get { return numExt; }			set { numExt = value; }		}		public string NumInt		{			get { return numInt; }			set { numInt = value; }		}		public string Suburb		{			get { return suburb; }			set { suburb = value; }		}		public string Delegation		{			get { return delegation; }			set { delegation = value; }		}		public string Town		{			get { return town; }			set { town = value; }		}		public string Zip		{			get { return zip; }			set { zip = value; }		}		public int EmployeNumber		{			get { return employeNumber; }			set { employeNumber = value; }		}		public bool? IsPrincipal		{			get { return isPrincipal; }			set { isPrincipal = value; }		}		public string GooglePoint		{			get { return googlePoint; }			set { googlePoint = value; }		}		public Guid? StateFk		{			get { return stateFk; }			set { stateFk = value; }		}		public Guid? ClienteFk		{			get { return clienteFk; }			set { clienteFk = value; }		}		public Guid? RegionFk		{			get { return regionFk; }			set { regionFk = value; }		}	}}